use aryan_technology;

CREATE TABLE Loans(    
    LoansID	VARCHAR(512),
    Age	INT,
    Income	INT,
    LoansAmount	INT,
    CreditScore	INT,
    MonthsEmployed	INT,
    NumCreditLines	INT,
    InterestRate	DOUBLE,
    LoansTerm	INT,
    DTIRatio	DOUBLE,
    Education	VARCHAR(512),
    EmploymentType	VARCHAR(512),
    MaritalStatus	VARCHAR(512),
    HasMortgage	VARCHAR(512),
    HasDependents	VARCHAR(512),
    LoansPurpose	VARCHAR(512),
    HasCoSigner	VARCHAR(512),
    Defaulters	VARCHAR(512)
);



select * from loans;


-- Identify customers who have defaulted on their loans.

select * from loans where defaulters = 1;

-- Calculate the average loan amount for each customer segment based on age group.

select Age_Group ,Avg(LoansAmount) as Average_loan_Amount from(  select *,
case when Age <= 30 then "Under 30" 
when Age > 30 and Age<= 50 then "Under 30-50" 
when Age> 50 then "Above 50"
end as Age_Group 
from loans) a group by Age_group;

-- Default Rate by Loan Type:
 select * from loans limit 5;
 
with cte as(select count(LoansID)  as total_loans ,
 (select count(loansID) as defaulter from loans where defaulters= 1) as deafulted_loans
 from loans) 
 
  select (deafulted_loans/total_loans)*100 as defaulter_percentage from cte;
